import React, { Component } from "react";
import style from "./TableTicket.module.css";

export default class TableTicket extends Component {
  render() {
    return (
      <React.Fragment>
        <h4 className="text-white text-uppercase">Danh sách ghế bạn chọn</h4>
        <div className={`${style["color-seat"]}`}>
          <div className="seat seat-orange">Ghế đã đặt</div>
          <div className="seat seat-yellow">Ghế đang đặt</div>
          <div className="seat seat-white">Ghế chưa đặt</div>
        </div>
        <table class="table">
          <thead>
            <tr>
              <th>Số ghế</th>
              <th>Giá</th>
              <th></th>
            </tr>
          </thead>
          <tbody></tbody>
        </table>
      </React.Fragment>
    );
  }
}
